import React from "react";
import Game from "./Game";
import ReactDOM from "react-dom";
import "./components/style.css";

function App() {
  return (
    <div>
      <h1>Choose</h1>

      <button
        onClick={() =>
          ReactDOM.render(<Game />, document.getElementById("root"))
        }
      >
        TicTacToe
      </button>
      <button>HackerTyper</button>
    </div>
  );
}

export default App;
